import { useState,useEffect } from 'react'
import {fetchData} from '../coin-gecko-api/fetchData'
import Coin from './Coin'

function CoinList(){
    const [coins,setCoins]=useState(null)
    useEffect(()=>{
      fetchData().then(data=>setData(data)).catch(err=>console.error(err))
    },[])//se executa doar cand se monteaza componenta(prima data)
    return(
        <tbody>
            {coins&& coins.map(element =><Coin coin={element} key={element.id}></Coin>)}
        </tbody>
    )
}
export default Coin
